  return <div className='help_cont'>
     <div className='help_page'>
     <h1>Need help? Write to us!</h1>
     <h4>We will respond within a few minutes...</h4>
     <div className='help_link'>
     <a target="_blank" href="https://upload.wikimedia.org/wikipedia/commons/a/a3/Woolly_mammoth_%28Mammuthus_primigenius%29_-_Mauricio_Ant%C3%B3n.jpg" className='footer_link'>
      support_fastchanger@proton.me
      <a href="#"><img className='tg' src='https://upload.wikimedia.org/wikipedia/commons/thumb/8/83/Telegram_2019_Logo.svg/512px-Telegram_2019_Logo.svg.png'/></a>
      </a>
     </div>
     </div>

    </div>;
}

export default Home;
